import React, { useState } from 'react';
import '../../styles/ReminderForm.css';

const ReminderForm = ({ pets, reminderTypes, onSubmit, onClose }) => {
    const [formData, setFormData] = useState({
        petId: '',
        typeId: '',
        reminderDate: '',
        reminderTime: '',
        notes: '',
        frequencyType: 'once',
        frequencyInterval: '',
        frequencyUnit: 'day',
        notificationType: 'at_start',
        notificationValue: '',
        notificationUnit: 'min'
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(formData);
    };

    const today = new Date().toISOString().split('T')[0];

    return (
        <div className="modal-overlay">
            <div className="modal-content">
                <div className="modal-header">
                    <h2>Создать напоминание</h2>
                    <button onClick={onClose} className="close-btn">&times;</button>
                </div>

                <form onSubmit={handleSubmit} className="reminder-form">
                    <div className="form-group">
                        <label htmlFor="petId">Питомец *</label>
                        <select
                            id="petId"
                            name="petId"
                            value={formData.petId}
                            onChange={handleChange}
                            required
                        >
                            <option value="">Выберите питомца</option>
                            {pets && pets.length > 0 ? (
                                pets.map(pet => (
                                    <option key={pet.id} value={pet.id}>
                                        {pet.petname || pet.name} ({pet.breed?.breedname || pet.breed?.name || 'Неизвестная порода'})
                                    </option>
                                ))
                            ) : (
                                <option value="" disabled>Нет доступных питомцев</option>
                            )}
                        </select>
                    </div>

                    <div className="form-group">
                        <label htmlFor="typeId">Тип напоминания *</label>
                        <select
                            id="typeId"
                            name="typeId"
                            value={formData.typeId}
                            onChange={handleChange}
                            required
                        >
                            <option value="">Выберите тип</option>
                            {reminderTypes.map(type => (
                                <option key={type.id} value={type.id}>
                                    {type.name || type.rtname}
                                </option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label htmlFor="reminderDate">Дата напоминания *</label>
                        <input
                            type="date"
                            id="reminderDate"
                            name="reminderDate"
                            value={formData.reminderDate}
                            onChange={handleChange}
                            min={today}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="reminderTime">Время напоминания *</label>
                        <input
                            type="time"
                            id="reminderTime"
                            name="reminderTime"
                            value={formData.reminderTime}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="notes">Заметки</label>
                        <textarea
                            id="notes"
                            name="notes"
                            value={formData.notes}
                            onChange={handleChange}
                            rows="3"
                            placeholder="Дополнительная информация..."
                        />
                    </div>

                    <div className="form-actions">
                        <button
                            type="button"
                            onClick={onClose}
                            className="btn btn-outline"
                        >
                            Отмена
                        </button>
                        <button
                            type="submit"
                            className="btn btn-primary"
                        >
                            Создать напоминание
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default ReminderForm;
